import React, { useState } from 'react'

export default function DownloadCertificate() {
    const [dateToday, setDateToday] = useState("");
    formattedDate();
    function formattedDate() {
        var result = "";
        var d = new Date();
        result += d.getFullYear() + "/" + (d.getMonth() + 1) + "/" + d.getDate();
        setDateToday(result);
    }
    return (
        <>
            <div className="container border rounded w-50 p-3 mt-5 text-center">
                <h1 className='text-center'>Covid Vaccination Certificate</h1>
                <table class="table">
                    <thead>
                        <tr>
                            <th>Dose No</th>
                            <th>1</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th>Date</th>
                            <td>{dateToday}</td>
                        </tr>
                        <tr>
                            <th>1</th>
                            <td>Mark</td>
                        </tr>
                        <tr>
                            <th>1</th>
                            <td>Mark</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </>
    )
}
